import React, { Component } from 'react';

class Home extends Component {
    render() {
        return (
                        <div style={{textAlign:"left"}}>

                <p>Hey, I am a software developer.</p>
                <p>Hopefully I can help you build your next product?</p>
            </div>
        );
    }
}

export default Home;
